import React from 'react';
import { Link } from 'react-router-dom';
import Image from '../img/plantlogo.jpg'
import { Avatar, Button } from 'antd';

const Navigation = () => {
  return (
    <>
    <nav id='navigation'>
        <div id='navBar' href='#home'>

            <div id='logoWrap'>
                <img id='logopic' src={Image} 
                />

            </div>


            <div id='navBtn'>
                <Link to='/login'>
                    <Button>Login</Button>
                </Link>

                <Link to='/signup'>
                    <Button>Sign Up</Button>
                </Link>
            </div>
        </div>
    </nav>
    </>
  );
};
export default Navigation;
